import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import { Route, Router, Routes } from "react-router-dom";
import FinalReport from "./components/pages/FinalReport";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <Router>
      <Routes>
        <Route path="/" element={<App />} />
        <Route path="reporte" element={<FinalReport />} />
      </Routes>
    </Router>
    <App />
  </React.StrictMode>
);
